import Activities from './pages/pageThree'
import Events from './pages/pageFour'

export default function App (){


    return ( 
        <Router>
        <div className = "cont"> 
          <Route exact path = '/' component = {Home}/>

            <Events/>
        </div>
        </Router>
    );

}
